import i18n from 'i18next';
import { initReactI18next } from 'react-i18next';
import Backend from 'i18next-http-backend';

i18n
.use(Backend)
.use(initReactI18next)
.init({
 lng: 'en',  // SET THE LANGUAGE DIRECTLY
 fallbackLng: 'en',
 debug: true,
 backend: {
     loadPath: 'src/locales/test.json'
 }
});

export default i18n;
